import { Vector3 } from "three";
import * as THREE from "three";
import { Sphere } from "./Sphere";

export class World {
    private objects = null;

    constructor() {
        this.objects = [];
    }

    runLoop(): void {
        let i = 0;
        while(true) {
            i++;
            console.log(i);
        }
    }

    test(): void {
        const s = new Sphere(new Vector3(0, 0, 0), 1);
        this.objects.push(s);
        console.log("hi");
        console.log(this.objects);
    }
}
